try {    
let url = `https://dlpanda.com/es?url=${link}&token=G7eRpMaa`;    
let response = await axios.get(url);
const html = response.data;
const $ = cheerio.load(html);
let imgSrc = [];
$('div.col-md-12 > img').each((index, element) => {
imgSrc.push($(element).attr('src'));
});
if (imgSrc.length === 0) {
return { data: 'Nenhuma imagem encontrada no link fornecido' };
}
return { data: imgSrc }; 
} catch (error) {
console.log(error);
return { data: 'Nenhuma resposta da p√°gina, tente novamente mais tarde'};
}
};
let imagesSent
if (imagesSent) return; imagesSent = true    
try {   
let hutaoimg = await ttimg(q); 
let result = hutaoimg?.data;
for (let d of result) {
await conny.sendMessage(from, {image: {url: d}}, {quoted: mek});
};
imagesSent = false
} catch {
imagesSent = false    
throw 'Nenhuma resposta da p√°gina, tente novamente mais tarde'
}
};
break

